    "2016-01-28T07:20:00.950522",nt"name": "liquor-moratorium-districts-dry-precincts-kml",nt"isopen":
    false,nt"url": null,nt"notes": "The Illinois Liquor Control Act of 1934
    permits voters in any precinct in the City of Chicago to vote an entire precinct
    u201cdryu201d through a local option referendum. rn rnIf a precinct has been voted
    u201cDry/Dry,u201d  no liquor licenses, other than a catereru2019s liquor license,
    may be issued.  rnIf a precinct has been voted "Dry/Wet" no liquor licenses can
    be obtained for the consumption of alcohol on premise but the sale of package goods
    is allowed along with the catereru2019s liquor license. rn rnThe VOTE_DRY_I column
    is the Precinct/Ward which was voted dry.  It reflects the Ward/Precinct that was
    effective at the date of the referendum.  Ward/Precinct boundaries may have changed
    since that date.  STATUS column indicates if the precinct was voted 'dry/dry' or
    'dry/wet'.  rnrnTo view or use this KML file, special GIS software such as Google
    Earth is required. To download, right-click the "Download" link above and choose
    "Save link as."",nt"license_title": "License Not Specified",nt"extras":
